《'''{{lj|ウルトラ リラックス}}'''》(Ultra Relax) 是动画《[[玩偶游戏]]》片头曲，由歌手、演员筱原友惠演唱。

== 简介 ==
* 由著名电子音乐乐队「电气Groove」成员石野卓球所创作。
* MV大量使用计算机图形制作。
* 「平成动画歌曲大奖」编曲部门获奖曲。
